css:
.github-PrTimeline {
  margin-top: 30px;
  border-top: 1px solid #dededf;
}
.github-PrTimeline > * {
  margin: 0 30px;
  padding: 30px 0;
  border-bottom: 1px solid #dededf;
}
.github-PrTimeline .emoji,
.github-PrTimeline g-emoji {
  margin-right: .25em;
}
.github-PrTimeline .author-avatar {
  width: 20px;
  height: 20px;
  margin-right: 5px;
}
.github-PrTimeline .pre-timeline-item-icon {
  position: absolute;
  margin-left: -25px;
  margin-top: 2px;
  color: #868e96;
}
.github-PrTimeline .commits .info-row {
  margin-bottom: 10px;
}
.github-PrTimeline .commit {
  display: table-row;
  align-items: center;
  margin-left: 20px;
}
.github-PrTimeline .commit:first-child {
  padding-top: 10px;
}
.github-PrTimeline .commit:only-child {
  padding-top: 0;
  padding-bottom: 0;
  margin-left: -10px;
}
.github-PrTimeline .commit + .issue {
  margin-top: 5px;
}
.github-PrTimeline .commit .commit-author {
  display: table-cell;
  white-space: nowrap;
  text-align: right;
}
.github-PrTimeline .commit .author-avatar {
  flex-basis: 20px;
}
.github-PrTimeline .commit .commit-message-headline {
  display: table-cell;
  font-size: .9em;
  padding: 0 3.33333333px;
  max-height: 20px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
  max-width: 0;
  width: 100%;
}
.github-PrTimeline .commit .commit-sha {
  display: table-cell;
  text-align: right;
  font-family: monospace;
  padding-left: 5px;
  font-size: .85em;
  color: #868e96;
}
.github-PrTimeline .merged-event {
  display: flex;
  align-items: center;
  font-size: .9em;
  line-height: 1.3;
  color: #868e96;
  border-bottom: 4px double #f1f3f5;
}
.github-PrTimeline .merged-event .username,
.github-PrTimeline .merged-event .merge-ref {
  font-weight: bold;
  color: #212529;
}
.github-PrTimeline .merged-event .sha {
  font-family: monospace;
}
.github-PrTimeline .merged-event ~ .issue {
  border-bottom-style: dashed;
}
.github-PrTimeline .issue .info-row {
  margin-bottom: 6.66666667px;
}
.github-PrTimeline .issue .comment-message-header {
  font-size: .9em;
  color: #868e96;
}
.github-PrTimeline .issue .github-DotComMarkdownHtml p:last-child {
  margin-bottom: 0;
}
.github-PrTimeline .issue .github-DotComMarkdownHtml pre > code {
  white-space: pre;
}
